  false,\n\t\"url\": null,\n\t\"notes\": \"Data include monthly snowfall and end-of-month
  snow depth for 140 stations across Canada. Stations that maintained at least 20
  years of data were chosen. The original data are from Atmospheric Environment Service
  Canadian Climate Centre and from NOAA's National Climatic Data Center. Data are
  divided into eight files by region or province: British Columbia (17 stations),
  Yukon and Northwest Territories (33 stations), Alberta (12 stations), Saskatchewan
  (115 stations), Manitoba (10 stations), Ontario (19 stations), Quebec (20 stations)
  and Atlantic Provinces (14 stations). Each data record contains a variable indicator
  to identify data as snow on the ground on the last day of the month (centimeters)
  or total snowfall for the month (millimeters). A list of stations, with latitude
  and longitude to hundredths of a degree, is included in documentation for this data
  set.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
